import "bootstrap/dist/css/bootstrap.min.css";
import React from "react";
const ListTasks = (props) => {
  if (Object.keys(props.liTasks).length === 0) {
    let disp = <p>Let's Start Sorting your Schedule</p>;
  }
  if (Object.keys(props.liTasks).length !== 0) {
    let disp = (
      <React.Fragment>
        {Object.keys(props.liTasks).map((x) => {
          return (
            <p key={x} className="card-text">
              {x}
            </p>
          );
        })}
      </React.Fragment>
    );

    return disp;
  }
};
export default ListTasks;
